$(document).ready(function () {
    var stuff;

    stuff = $('canvas').data('stuff');
    if (typeof stuff === 'undefined') {
        return;
    }

    var config = {
        type: 'doughnut',
        data: {
            datasets: [{
                data: [stuff[0], stuff[1]],
                backgroundColor: [
                    "#133960",
                    "#ffc025"
                ]
            }],
            labels: []
        },
        options: {
            responsive: true,
            tooltips: false,
            animation: {
                animateScale: true,
                animateRotate: true
            }
        }
    };

    window.onload = function () {
        var ctx = document.getElementById("chart-area").getContext("2d");
        window.myDoughnut = new Chart(ctx, config);
    };
});

$(document).ready(function () {
    $('.home-album__content').slick({
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplaySpeed: 5000,
        autoplay: true,
        speed: 1000,
        arrows: false,
        responsive: [
            {
                breakpoint: 990,
                settings: {
                    centerMode: true,
                    centerPadding: '40px',
                    slidesToShow: 1,
                }
            }
        ]
    });
});

$(document).ready(function () {
    /* Apply fancybox to multiple items */

    $("a.pop-img").fancybox({
        'transitionIn': 'elastic',
        'transitionOut': 'elastic',
        'speedIn': 600,
        'speedOut': 200,
        'overlayShow': false
    });

    $('.ads-slider').slick();

});

$(document).ready(function () {
    $('.news-content__cover').slick({
        autoplay: true,
        autoplaySpeed: 5000,
        speed: 1000,
        infinite: true,
        fade: true,
        cssEase: 'linear'
    });

    $('.fancybox').fancybox();

    //----- Menu system -------//
    //Toggle mobile menu & search
    $('.toggle-nav').click(function() {
        console.log('toggle nav');
        $('.mobile-nav').slideToggle(200);
        $('.mobile-nav').toggleClass('header-nav-opened');
        $('.mobile-search').slideUp(200);
    });
    //Close navigation on anchor tap

    $('.toggle-search').click(function() {
        console.log('toggle search');
        $('.mobile-search').slideToggle(200);
        $('.mobile-nav').slideUp(200);
    });

    //Mobile menu accordion toggle for sub pages
    $('.mobile-nav > ul > li.menu-item-has-children').append('<div class="accordion-toggle"><div class="fa fa-angle-down"></div></div>');
    $('.mobile-nav .accordion-toggle').click(function(e) {
        $(this).siblings('ul').slideToggle(200);
        $(this).toggleClass('toggle-background');
        $(this).find('.fa').toggleClass('toggle-rotate');
    });
    $('.mobile-nav .menu-item-has-children > a').click(function(e) {
        e.preventDefault();
        $(this).siblings('.accordion-toggle').trigger('click');
    });


    var $nav = $('#nav');
    var $headerNav = $('.header-nav-top');

    if ($nav.length) {
        var $blueBar = $('.header-nav-top');

        //posTop = $nav.position().top;
        posTop = 80;
        $(window).scroll(function () {
            console.log(posTop);
            var y = $(this).scrollTop();

            if (y > posTop) {
                $('#navigate-block').css("top", -posTop+"px");    $nav.addClass('scroll__nav');
                $headerNav.addClass('scroll__nav-top');
                $('.logo-top').addClass('scroll__logo-top');
                $('.logo-scroll').addClass('scroll__logo-scroll');
                $('.social-header').addClass('social-header__scroll');
            }
            else {
                $('#navigate-block').css("top", -y+"px");   $nav.removeClass('scroll__nav');
                $headerNav.removeClass('scroll__nav-top');
                $('.logo-top').removeClass('scroll__logo-top');
                $('.logo-scroll').removeClass('scroll__logo-scroll');
                $('.social-header').removeClass('social-header__scroll');
            }
        });
    }
    //----- end Menu System ------//
});
